import { useSelector } from 'react-redux';

const Table = () => {
  const table = useSelector(state => state.table);
  return (
    <section>
      <h2>Table: {table.id} </h2>
      <p>Status: {table.status} </p>
      <button>Show more</button>
    </section>
  )
}

export default Table;
